    false,nt"url": null,nt"notes": "Design guidelines and recommendations for
    planning and delivering surface transportation projects on Service lands. The main
    holding (Roadway Design Guidelines) is a is a best practice manual that highlights
    state of the art ecological, planning, design and engineering considerations for
    roadway projects that heed both the significant benefits and impacts these projects
    present. Roadway projects on FWS managed lands should conform to planning and design
    criteria that have been established to support the FWS mission. This document provides
    such criteria in the form of guidelines. Included in this holding are two additional
    documents: 1) instructions that detail how the design guidelines are to be applied
    to transportation projects, and 2) the 'Project Acknowledgments' checklist to document
    incorporation of the design guidelines in project development.",nt"owner_org":
